import React, { Component } from 'react';
import './InsertNumber.css';


class InsertNumber extends Component {
    constructor(props) {
        super(props)
        state = {
            numbers: ''
        }
    }
    handleChange = (event) => {
        event.preventDefault();
        this.setState({
            numbers: event.target.value
        })
    }
    render() {
        return (
            <div>
                <body className="App-insert">
                    <p style={{ fontSize: 40, textAlign: "center" }}>Insert ur number</p>
                    <form>
                        <p>
                            <input
                                type="text"
                                placeholder="example :1,2,3,4,5"
                                onChange="this.handleChange"
                            />
                        </p>
                    </form>
                </body>


            </div>
        );
    }
}

export default InsertNumber;
